import { administration } from "../../env/environment";
import { default as loginPage } from "../../pageobjects/administration.page/Login.page";


describe('Administration - Login tests', () => {
    it('Check validation localization', () => {
        administration();
        browser.maximizeWindow();
        const signInText = $(".form .card__body").$("span*=Sign In")
        console.log(signInText);
        signInText.click();
    });

    it('awdaw', () => {
        administration();
        browser.maximizeWindow();
        loginPage.usernameInput.setValue('vikNova');
        loginPage.passwordInput.setValue('mono.123');
        loginPage.signInBtn.click();
        const organizationMenuIcon = $("button[title='Organization'] > .icomoon.icomoon--big.icomoon--nav-organization.nav--primary__link__icon");
        organizationMenuIcon.waitForDisplayed();
        $("a*=Start company wizard").click();
        $(".view--wizard__nav .view--wizard__nav__item:nth-of-type(2)").isDisplayed();
    });

    it('bla', () => {
        $(".view--wizard__nav .view--wizard__nav__item:nth-of-type(2)").isDisplayed();
    })
});

