import { expect } from "chai";
import { administration } from "../../env/environment";
import { loginPage, sideMenuPage } from "../../pageobjects/administration.page";
import betSlipsPage from "../../pageobjects/administration.page/BetSlips.page";

describe("Administration - Bet slips report", () => {
    it("Open bet slips page", () => {
        administration();
        browser.maximizeWindow();
        loginPage.usernameInput.setValue('vikNova');
        loginPage.passwordInput.setValue('mono.123');
        loginPage.signInBtn.click();
        sideMenuPage.ticketsButton.waitForDisplayed();
        sideMenuPage.ticketsButton.click();
        sideMenuPage.betSlipsButton.click();
        expect(betSlipsPage.betSlipsTitle).to.exist;
    });

    it("Filter Slip by id, verify event is visible", () => {
        betSlipsPage.betSlipId.addValue("3-16033");
        betSlipsPage.viewButton.click();
        const slipResult = $("div*=1136874 Alliance-Titans**LIVE 2:0");
        slipResult.waitForDisplayed();
        expect(slipResult).to.exist;
    });

    it("Verify validation for invalid date (1.1.1)", () => {
        betSlipsPage.selectFilterTab.click();
        betSlipsPage.selectDateFrom();
    });
});

