import { administration } from "../../env/environment";
import { loginPage, sideMenuPage } from "../../pageobjects/administration.page";
import { randomStringNum, searchTable, verifyElementValue } from "../../pageobjects/common/Common.page";
import shopPage from "../../pageobjects/administration.page/Shop.page";

describe("Administration - Shop tests", () => {

    it("Open Shop page", () => {
        administration();
        browser.maximizeWindow();
        loginPage.usernameInput.addValue("vikNova");
        loginPage.passwordInput.addValue("mono.123");
        loginPage.signInBtn.click();
        sideMenuPage.ticketsButton.waitForDisplayed();
        browser.url("http://qa.admin.gp.develop/platform/shop");
        const shopCtaMessage = $("h3*=Shop is not selected");
        shopCtaMessage.waitForDisplayed();
        expect(shopCtaMessage).to.exist;
    });

    it("Verify shop is selectable and is opened", () => {
        searchTable("Vanja");
        $(".treeview__list").$("span=Vanja").click();
        expect(shopPage.nameInput).to.exist;
        verifyElementValue(shopPage.nameInput, "Vanja");
    });

    it("Verify address tab is opened and displayed", () => {
        shopPage.addressTab.click();
        const addressBody = $(".card__body");
        addressBody.waitForDisplayed();
        addressBody.isDisplayed();
    });

    it("Verify shop number is updated", () => {
        shopPage.addressShopNumberInput.clearValue();
        shopPage.addressShopNumberInput.addValue(randomStringNum());
        $("span=Save").click();
        const successfulUpdateMessage = $(".Toastify").$("div*=Succeeded to update address in shop");
        successfulUpdateMessage.waitForDisplayed();
        expect(successfulUpdateMessage).to.exist;
    });

});

