import { mobileML } from "../../env/environment";
import { verifyIsNotVisible, verifyIsVisible } from "../../pageobjects/common/Common.page";

describe("Results tests", () => {

    it("Open results page", () => {
        mobileML();
        $("label=Do not ask again").click();
        $(".u-icon--mobile").click();
        $("strong=Don't show this message again").click();
        browser.url("http://qa.m.webml.gp.develop/en/results");
        const pageError = $("span=This page isn’t working");
        verifyIsNotVisible(pageError);
        browser.pause(5);
    });
    //Tennis
    it("Open tennis, verify page does not crash", () => {
        $("div=Tennis").click();
        const pageError = $("span=This page isn’t working");
        verifyIsNotVisible(pageError);
    });
    it("Open ATP, verify page does not crash", () => {
        browser.url("http://qa.m.webml.gp.develop/en/results");
        $("div=Tennis").click();
        $("span=ATP").click();
        const pageError = $("span=This page isn’t working");
        verifyIsNotVisible(pageError);
    });
    it("Select first tournament, verify page does not crash", () => {
        browser.url("http://qa.m.webml.gp.develop/en/results");
        $("div=Tennis").click();
        $("span=ATP").click();
        const firstTournament = $("#tournament .nav--tertiary__menu:nth-of-type(5) .nav--quaternary__item:nth-of-type(1)");
        verifyIsVisible(firstTournament);
        firstTournament.click();
        browser.pause(1000);
        const pageError = $("span=This page isn’t working");
        verifyIsNotVisible(pageError);
    });

});

